The milestone based scoring defines a tip's score by investigating the tip's relation to the cone it approves and previous issued milestones. A tip can have one of 3 score states: 0: The tip is lazy and should not be selected. 1: The tip is somewhat lazy. 2: The tip is a non-lazy tip. Definitions: C1: Max allowed delta value for the YMRSI of a given message in relation to the current LSMI. C2: Max allowed delta value between OMRSI of a given message in relation to the current LSMI. M: Max allowed delta value between OMRSI of the given message in relation to the current LSMI. M is the below max depth (BMD) parameter. Recommended defaults: C1 = 8 milestones C2 = 13 milestones M = 15 milestones Scoring Algorithm (pseudo code): enum Score ( LAZY = 0 SEMI_LAZY = 1 NON_LAZY = 2
) const ( C1 = 8 C2 = 13 M = 15
) func score(tip Tip) Score { // if the LSMI to YMRSI delta is over C1, then the tip is lazy if (LSMI - YMRSI(tip) > C1) { return Score.LAZY } // if the OMRSI to LSMI delta is over M/below-max-depth, then the tip is lazy if (LSMI - OMRSI(tip) > M) { return Score.LAZY } if (LSMI - OMRSI(tip) > C2) { return Score.SEMI_LAZY } return Score.NON_LAZY
}
